import React, { Component } from "react";
import { Grid, IconButton, CardMedia } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";
import "./Home.css";

class Home extends Component {
  render() {
    return (
      <div
        style={{
          justifyContent: "center",
          alignContent: "center",
          alignItems: "center"
        }}
      >
        <CardMedia
          image="https://images-na.ssl-images-amazon.com/images/I/7177FQIcHBL._UL1500_.jpg"
          width="100%"
          style={{
            height: 500
          }}
        >
          <Grid
            container
            direction="row"
            style={{
              alignContent: "center",
              alignItems: "center",
              justifyContent: "space-between",
              flexGrow: 1
            }}
          >
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronLeft}
              />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "grey" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </CardMedia>
      </div>
    );
  }
}

// const Home = withStyles(styles)(({ classes }) => (

// ));

export default Home;
